import React from 'react';

const TodoList = () => {
    return (
        <div className='container'>
            <h3>Todos list</h3>
            <table className='table table-hover'>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                </thead>

            </table>
        </div>
    )
}
export default TodoList;
